import java.util.List;

public class SetObject {
	private String name;
	private int cost;
	private List<Integer> set; 

	public SetObject(String name, int cost) {
		// TODO Auto-generated constructor stub
		this.name = name;
		this.cost = cost;
	}

	public void setSet(List<Integer> set) {
		this.set = set;
	}

	public String getName() {
		return name;
	}
	
	
 
}
